Using the move_to keyword explicitly transfers ownership of a variable to another scope or function. Once moved, the original variable is no longer accessible. Example: Transferring Ownership of a Ticket module TokenManager { use Std::Signer;
​ struct Token has key, store { id: u64, }
​ public fun create_token(owner: &signer, token_id: u64) { let new_token = Token { id: token_id }; move_to(owner, new_token); // Moves `new_token` into global storage }
​ public fun transfer_token(sender: &signer, receiver: address, token_id: u64) { let token = move_from<Token>(Signer::address_of(sender), token_id); // Moves out `Token` from sender's storage move_to(&receiver, move token); // Use `move` keyword to transfer ownership }
} In this scenario, issuing a ticket creates a Ticket instance. When transfer_ticket is called with a Ticket, the ticket's ownership is moved, simulating a real-world ticket transfer.

